 foods. In the United States it is found among the urban poor, the elderly, alcoholics, and patients with malabsorption. (From Cecil Textbook of Medicine, 19th ed, p1179)','en',1,'2007-10-18 04:28:24',1,NULL,'6890FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(6933,123123,'Inflammation, often mild, of the conjunctiva caused by a variety of viral agents. Conjunctival involvement may be part of a systemic infection.','en',1,'2007-10-18 04:28:24',1,NULL,'6933FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(7066,123529,'DEF: Discharge of purulent fluid from the urethra. DESC: Commonly caused by Gonorrhea and/or chlamydia. REF: Merck Manual','en',1,'2007-10-18 04:28:24',1,'2016-05-21 14:00:44','7066FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(7067,123529,'ECOULEMENT URETRAL','fr',1,'2007-07-13 14:56:43',1,'2016-05-21 14:00:44','7067FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(7275,124129,'Infection with nematodes of the genus TRICHURIS, formerly called Trichocephalus.','en',1,'2007-10-18 04:28:24',1,NULL,'7275FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(7773,126127,'Expulsion of the products of conception before the completion of gestation without deliberate interference.','en',1,'2007-10-18 04:28:24',1,'2016-07-10 02:55:15','7773FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(7801,126208,'Congenital defects of closure of one or more vertebral arches, which may be associated with malformations of the spinal cord, nerve roots, congenital fibrous bands, lipomas, and congenital cysts. These malformations range from mild (e.g., SPINA BIFIDA OCCULTA) to severe, including rachischisis where there is complete failure of neural tube and spinal cord fusion, resulting in exposure of the spinal cord at the surface. Spinal dysraphism includes all forms of spina bifida. The open form is called SPINA BIFIDA CYSTICA and the closed form is SPINA BIFIDA OCCULTA. (From Joynt, Clinical Neurology, 1992, Ch55, p34)','en',1,'2007-10-18 04:28:24',1,NULL,'7801FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(7914,126558,'An infectious disease caused by bacteria of the genus SHIGELLA. This condition is characterized by intestinal pain and diarrhea.','en',1,'2007-10-18 04:28:24',1,NULL,'7914FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(8328,127579,'The persistence to perform a learned behavior (facts or experiences) after an interval has elapsed in which there has been no performance or practice of the behavior.','en',1,'2007-10-18 04:28:24',1,NULL,'8328FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(8452,127990,'Fever in which the etiology cannot be ascertained.','en',1,'2007-11-02 20:16:08',1,'2016-05-27 02:00:14','8452FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(8508,128126,'Bronchial hemorrhage manifested with spitting of blood.','en',1,'2007-10-18 04:28:24',1,NULL,'8508FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(9072,129566,'A developmental anomaly characterized by the presence of more than five fingers on the hand or more than five toes on the foot in primates. In non-primate vertebrates, it refers to the presence of more than the normal number of toes on the forelimb or hindlimb. (Dorland, 27th ed; Stedman, 25th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'9072FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(9467,131113,'Inflammation of the middle ear.','en',1,'2007-11-02 20:16:26',1,NULL,'9467FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(9468,131113,'Otite moyenne','fr',1,'2007-09-06 08:51:25',1,NULL,'9468FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(9762,132636,'A syndrome produced by severe protein deficiency, characterized by retarded growth, changes in skin and hair pigment, edema, and pathologic changes in the liver, including fatty infiltration, necrosis, and fibrosis. The word is a local name in Gold Coast, Africa, meaning \"displaced child\". Although first reported from Africa, kwashiorkor is now known throughout the world, but mainly in the tropics and subtropics. It is considered to be related to marasmus. (From Dorland, 27th ed)','en',1,'2007-10-18 04:28:24',1,NULL,'9762FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),(9763,132636,'MARASME','fr',1,'2007-07-13 13:53:41',1,NULL,'9763FFFFFFFFFFFFFFFFFFFF