INSERT INTO `encounter_type` VALUES (1,'Discharge','Indicates that a patient\'s inpatient care at the hospital is ending, and they are expected to leave soon.',2,'2013-08-01 13:27:50',0,NULL,NULL,NULL,'181820aa-88c9-479b-9077-af92f5364329',NULL,NULL,NULL,NULL),(2,'Admission','Indicates that the patient has been admitted for inpatient care, and is not expected to leave the hospital unless discharged.',2,'2013-08-01 13:27:27',0,NULL,NULL,NULL,'e22e39fd-7db2-45e7-80f1-60fa0d5a4378',NULL,NULL,NULL,NULL),(3,'Visit Note','Encounter where a full or abbreviated examination is done, usually leading to a presumptive or confirmed diagnosis, recorded by the examining clinician.',2,'2013-08-02 00:16:06',0,NULL,NULL,NULL,'d7151f82-c1f3-4152-a605-2f9ea7414a79',NULL,NULL,NULL,NULL),(4,'Check Out','The patient is explicitly leaving the hospital/clinic. (Usually no formal encounter is captured for this.)',2,'2013-08-02 00:14:43',0,NULL,NULL,NULL,'25a042b2-60bc-4940-a909-debd098b7d82',NULL,NULL,NULL,NULL),(5,'Check In','Indicates the patient has done the required paperwork and check-in to begin a visit to the clinic/hospital.',2,'2013-08-02 00:13:23',0,NULL,NULL,NULL,'ca3aed11-1aa4-42a1-b85c-8332fc8001fc',NULL,NULL,2,'2018-01-04 14:15:36'),(6,'Transfer','Indicates that a patient is being transferred into a different department within the hospital. (Transfers out of the hospital should not use this encounter type.)',2,'2013-08-01 13:28:10',0,NULL,NULL,NULL,'7b68d557-85ef-4fc8-b767-4fa4f5eb5c23',NULL,NULL,NULL,NULL),(7,'Vitals','For capturing vital signs',2,'2013-08-12 07:08:05',0,NULL,NULL,NULL,'67a71486-1a54-468f-ac3e-7091a9a79584',NULL,NULL,NULL,NULL),(8,'Orden Aceptada','Tipo de encuentro que describe a una orden que ha sido aceptada por el usuario pertinente.',1,'2018-05-10 18:50:57',0,NULL,NULL,NULL,'34602d34-d15c-4c7e-bf2a-012c72aeabde',NULL,NULL,NULL,NULL),(9,'Orden Cancelada','Tipo de encuentro que describe a una orden que ha sido cancelada por el usuario pertinente.',1,'2018-05-10 18:51:18',0,NULL,NULL,NULL,'e6e7a42f-a8d3-4ac9-9018-9e589c89f9df',NULL,NULL,NULL,NULL),(10,'Orden Finalizada','Tipo de encuentro que describe a una orden que ha sido finalizada por el usuario pertinente.',1,'2018-05-10 18:51:44',0,NULL,NULL,NULL,'f06bf0be-6b50-4cfd-85ac-6cb286ea781f',NULL,NULL,NULL,NULL),(11,'Orden Nueva','Tipo de encuentro que describe a una orden que ha sido creada por el usuario pertinente.',1,'2018-05-10 18:51:59',0,NULL,NULL,NULL,'0becaac6-3e3c-4cb0-955c-2baf6d05b755',NULL,NULL,NULL,NULL),(12,'Orden Pagada','Tipo de encuentro que describe a una orden que ha sido pagada por el usuario pertinente.',1,'2018-05-10 18:52:19',0,NULL,NULL,NULL,'108c7b76-4559-47c3-8e82-892a71fedec0',NULL,NULL,NULL,NULL);
